package com.xxx.store.controller;



import com.xxx.user.service.UploadFileService;
import com.xxx.utils.OSSClientUtil;
import org.apache.log4j.Logger;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Controller;
import org.springframework.ui.ModelMap;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;

import javax.servlet.http.HttpServletRequest;


@Controller
@RequestMapping("/test")
public class TestController {
    private Logger logger = Logger.getLogger(TestController.class);
    @Autowired
    private UploadFileService uploadFileService;

    @RequestMapping(value = "/testHtml", method = {RequestMethod.GET})
    public String merchantLogin(HttpServletRequest request, ModelMap modelMap) throws Exception {
        //图片base64  由前端处理传至后台
        String base64 = "data:image/png;base64,";
        //上传图片至oss  返回图片key值   【数据库图片字段 href存储该key值
        Integer kay = uploadFileService.saveOssUploadFileByBase64(base64);
        //通过key返回图片路径   【查询图片路径时   通过href(key)获取图片路径返回前端
        String imgUrl = OSSClientUtil.getObjectUrl(kay.toString());
        System.out.println(imgUrl);

        return "";
    }




}
